import React, { useState } from 'react';

function ExitDetailsForm() {
  const [formData, setFormData] = useState({
    name: '',
    mobileNumber: '',
    programEnrolled: '',
    enrollmentYear: '',
    timeOfExit: '',
    dateOfReturn: '',
    timeOfReturn: '',
    purposeOfExit: '',
  });

  const handleChange = (event) => {
    setFormData({ ...formData, [event.target.name]: event.target.value });
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // Submit form data here
    console.log(formData);
  };

  return (
    <div className="exit-details-form">
      <h2>Exit Details Form</h2>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="name">Name</label>
          <input
            type="text"
            name="name"
            id="name"
            value={formData.name}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="mobileNumber">Mobile Number</label>
          <input
            type="tel"
            name="mobileNumber"
            id="mobileNumber"
            value={formData.mobileNumber}
            onChange={handleChange}
            required
          />
        </div>
        {/* Other form fields */}
        <div className="form-group">
          <label htmlFor="programEnrolled">Program Enrolled</label>
          <input
            type="text"
            name="programEnrolled"
            id="programEnrolled"
            value={formData.programEnrolled}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="enrollmentYear">Enrollment Year</label>
          <input
            type="number"
            name="enrollmentYear"
            id="enrollmentYear"
            value={formData.enrollmentYear}
            onChange={handleChange}
            required
          />
        </div>
        {/* ... */}
        <div className="form-group">
          <label htmlFor="timeOfExit">Time of Exit</label>
          <input
            type="time"
            name="timeOfExit"
            id="timeOfExit"
            value={formData.timeOfExit}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="dateOfReturn">Date of Exit</label>
          <input
            type="date"
            name="dateOfReturn"
            id="dateOfReturn"
            value={formData.dateOfReturn}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="timeOfReturn">Time of Return</label>
          <input
            type="time"
            name="timeOfReturn"
            id="timeOfReturn"
            value={formData.timeOfReturn}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="dateOfReturn">Date of Return</label>
          <input
            type="date"
            name="dateOfReturn"
            id="dateOfReturn"
            value={formData.dateOfReturn}
            onChange={handleChange}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="purposeOfExit">Purpose of Exit</label>
          <textarea
            name="purposeOfExit"
            id="purposeOfExit"
            value={formData.purposeOfExit}
            onChange={handleChange}
            required
          />
        </div>
        <button type="submit">Submit Form</button>
      </form>
    </div>
  );
}

export default ExitDetailsForm;
